import{_ as e,o as r,c as i,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 54.1-2206 Waiver of examination.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-2206.md","filePath":"vacode/54.1-2206.md"}'),t={name:"vacode/54.1-2206.md"},o=a('<h1 id="§-54-1-2206-waiver-of-examination" tabindex="-1">§ 54.1-2206 Waiver of examination. <a class="header-anchor" href="#§-54-1-2206-waiver-of-examination" aria-label="Permalink to &quot;§ 54.1-2206 Waiver of examination.&quot;">​</a></h1><p>A. The Board may waive the requirement for examination pursuant to § <a href="http://law.lis.virginia.gov/vacode/54.1-2205/" target="_blank" rel="noreferrer">54.1-2205</a> upon written application from an individual who holds an unexpired certificate or license, or its equivalent, issued by a regulatory body of another state, territory or possession of the United States and is not the subject of any disciplinary proceeding before such regulatory body which could result in the suspension or revocation of his certificate or license, if such other state, territory or possession recognizes the license issued by the Board.</p><p>B. The Board shall waive the requirement for examination pursuant to § <a href="http://law.lis.virginia.gov/vacode/54.1-2206.2/" target="_blank" rel="noreferrer">54.1-2206.2</a> upon the written application from an individual who holds an unexpired certificate or its equivalent issued by a regulatory body of another state, territory or possession of the United States or has been provisionally certified under the U.S. Army Corps of Engineers Wetland Delineator Certification Program of 1993 and is not the subject of any disciplinary proceeding before such regulatory body, which could result in the suspension or revocation of his certificate.</p><p>1987, c. 626, § 54-976; 1988, c. 765; 1991, c. 181; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0784" target="_blank" rel="noreferrer">784</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0447" target="_blank" rel="noreferrer">447</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0091" target="_blank" rel="noreferrer">91</a>; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0777" target="_blank" rel="noreferrer">777</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0859" target="_blank" rel="noreferrer">859</a>.</p>',4),n=[o];function s(l,c,h,f,d,p){return r(),i("div",null,n)}const _=e(t,[["render",s]]);export{g as __pageData,_ as default};
